export function add20(a: number, b: number): number {
  return a + b;
}

export function subtract20(a: number, b: number): number {
  return a - b;
}

export function multiply20(a: number, b: number): number {
  return a * b;
}

export function divide20(a: number, b: number): number {
  return a / b;
}
